import React from 'react';



const inner_table = {
	backgroundColor: 'grey',
	padding: '1vh',
}

const table_window = {
	backgroundColor: 'white',
}

class PriceTrending extends React.Component {

	//
	render() {
		return (
			<div className="inner_table">
				<div className="data_window">
					<table>
						<tr>
							<th>Pair</th>
							<th>Last Price</th>
							<th>Change</th>
						</tr>
							<tr>
								<td>Jill</td>
								<td>Smith</td>
								<td>50</td>
							</tr>
							<tr>
								<td>Jill</td>
								<td>Smith</td>
								<td>50</td>
							</tr>
					</table>
				</div>
			</div>
		);
	}
}

export default PriceTrending;
